import React, { useState } from 'react';
import './LoginFormY.css';
import { Link, useHistory } from 'react-router-dom';
import { useFormik } from 'formik';
import { simpleFormSchema } from '../schemas';
import Axios from 'axios';

const initialValues = {
  username: '',
  password: '',
};

const LoginFormY = () => {
  const history = useHistory();
  const [formValues, setFormValues] = useState(initialValues);

  const { errors, handleBlur, touched, handleChange, handleSubmit } = useFormik({
    initialValues: formValues,
    validationSchema: simpleFormSchema,
    onSubmit: async (values, { setSubmitting }) => {
      try {
        const response = await Axios.post('https://dashboard-3frk.onrender.com/loginData', values);
        if (response.status === 200) {
          console.log('Login successful');
          // Clear the form fields by updating the state
          setFormValues(initialValues);
          history.push('/dashboard');
        } else {
          console.error('Login failed');
        }
      } catch (error) {
        console.error('Error during login:', error);
      } finally {
        setSubmitting(false);
      }
    },
  });

  const handleFormChange = (event) => {
    // Update the form values in the component's state when the input changes
    const { name, value } = event.target;
    setFormValues({ ...formValues, [name]: value });
  };

  return (
    <>
      <section className="Form-second-main-section">
        <div className="color"></div>
        <div className="color"></div>
        <div className="color"></div>
        <div className="circles">
          <div className="circle"></div>
          <div className="circle"></div>
          <div className="circle"></div>
        </div>
        <div className="box">
          <div className="square"></div>
          <div className="square"></div>
          <div className="square"></div>
          <div className="square"></div>
          <div className="square"></div>
          <div className="Form-second-container">
            <div className="form-second">
              <h2>Login Form</h2>
              <form onSubmit={handleSubmit}>
                <div className="Form-second-inputBox">
                  <input
                    type="text"
                    autoComplete="off"
                    placeholder="Username"
                    value={formValues.username}
                    onChange={handleFormChange}
                    onBlur={handleBlur}
                    minLength="4"
                    maxLength="20"
                    id="username"
                    name="username"
                  />
                  {errors.username && touched.username ? <p>{errors.username}</p> : null}
                </div>
                <div className="Form-second-inputBox">
                  <input
                    type="password"
                    autoComplete="off"
                    placeholder="Password"
                    value={formValues.password}
                    onChange={handleFormChange}
                    onBlur={handleBlur}
                    minLength="6"
                    maxLength="50"
                    id="password"
                    name="password"
                  />
                  {errors.password && touched.password ? <p>{errors.password}</p> : null}
                </div>
                <div className="Form-second-inputBox">
                  <input type="submit" value="Login" />
                </div>
                <p className="Form-second-forget">
                  Forgot password ? <Link to="#">Click Here</Link>
                </p>
                <p className="Form-second-forget">
                  Don't have an account ? <Link to="#">Sign up</Link>
                </p>
              </form>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default LoginFormY;
